import franc from 'franc';
import * as swearjar from 'swearjar';

// eslint-disable-next-line import/prefer-default-export
export function getWordCloudAnalysis(json) {
  try {
    return {
      profanity: calculatesProfanityUsage(json),
      language: languageDetection(json),
    };
  } catch (err) {
    console.error(err);
  }
}

function calculatesProfanityUsage(obj) {
  const typedWords = obj.my_word_counts;
  const score = {
    inappropriate: 0,
    sexual: 0,
    insult: 0,
    discriminatory: 0,
    blasphemy: 0,
    neutral: 0,
  };

  Object.entries(typedWords).forEach(e => {
    const word = e[0];
    const freq = e[1];
    if (swearjar.profane(word)) {
      const card = swearjar.scorecard(word);
      Object.entries(card).forEach(s => {
        score[s[0]] += freq;
      });
    } else {
      score.neutral += 1;
    }
  });

  return score;
}

function languageDetection(obj) {
  const typedWords = Object.keys(obj.my_word_counts).join(' ');
  return franc(typedWords);
}

